import React, { Component } from "react";

class BrokenClick extends Component {
    constructor(props){
        super(props);
        this.state = { clicked: false};
    }
    render (){
        return(
            <div>
                <h1>{this.state.clicked ? "The button is clicked" : "Not clicked"}</h1>
                <button>Click me.</button>
            </div>
        )
    }
}

export default BrokenClick;
